import React from 'react'

const ChatBox = () => {
  return (
    <div className='chatbox_bg'>
        <div className='chatbox_box'>
            <div className='chatbox_contents'>
                <div className='chatbox_input'></div>
            </div>
        </div>
    </div>
  )
}

export default ChatBox
